import {Link,useNavigate} from 'react-router-dom'
import { useEffect, useState } from 'react'
import  { getUserprofile } from '../services/user.services'
export default function Display_User(props)
{
    //var result,name,city,state,country,zip,bd,gender
    const[name,setname]=useState([])
    const[city,setcity]=useState([])
    const[state,setstate]=useState([])
    const[country,setcountry]=useState([])
    const[zip,setzip]=useState([])
    const[bd,setbd]=useState([])
    const[gender,setgender]=useState([])
    useEffect(()=>{
        getup(sessionStorage["useremail"])
    })

    async function getup(email)
    {
        //console.log("IN HERE")
        const result=await getUserprofile(email)
        /* name=result[0]+" "+result[1]
        city=result[3]
        state=result[7]
        country=result[4]
        zip=result[5]
        bd=result[2]
        gender=result[6]
        sessionStorage['name']=name
        sessionStorage['city']=city
        sessionStorage['state']=state
        sessionStorage['country']=country
        sessionStorage['zip']=zip
        sessionStorage['bd']=bd */
        setname(result[0]+" "+result[1])
        //console.log(name)
    }

    return(
        <div>
            <h2>Profile</h2>
            <div>
                <h4>Name:{sessionStorage['name']}</h4>
                <h4>Email ID:{sessionStorage['useremail']}</h4>
                <h4>City:{sessionStorage['city']}</h4>
                <h4>State:{sessionStorage['state']}</h4>
                <h4>Country:{sessionStorage['country']}</h4>
                <h4>Postal Code:{sessionStorage['zip']}</h4>
                <h4>Birth Date:{sessionStorage['bd']}</h4>
            </div>
        </div>
    )
}
